import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeMessage, setActiveMessage] = useState(0);
  const [isProcessing, setIsProcessing] = useState(true);

  const messages = [
    { text: "Initializing language model parameters...", type: "system" },
    { text: "Loading pre-trained embeddings...", type: "system" },
    { text: "What aspects of AI alignment interest you?", type: "user" },
    { text: "Analyzing query using attention mechanisms...", type: "process" },
    { text: "I focus on ensuring AI systems remain beneficial and aligned with human values through robust optimization and safety constraints.", type: "assistant" },
  ];

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveMessage(prev => (prev < messages.length - 1 ? prev + 1 : prev));
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
    }}>
      {/* Main Chat Interface */}
      <div style={{
        position: 'relative',
        width: '450px',
        height: '380px',
        margin: '50px auto',
        backgroundColor: 'rgba(13, 14, 20, 0.95)',
        borderRadius: '24px',
        overflow: 'hidden',
        border: '1px solid rgba(147, 197, 253, 0.2)',
        boxShadow: '0 0 40px rgba(147, 197, 253, 0.15)',
        backdropFilter: 'blur(10px)',
      }}>
        {/* Chat Header */}
        <div style={{
          padding: '15px 20px',
          borderBottom: '1px solid rgba(147, 197, 253, 0.1)',
          display: 'flex',
          alignItems: 'center',
          gap: '10px',
          background: 'linear-gradient(90deg, rgba(147, 197, 253, 0.1), rgba(96, 165, 250, 0.1))',
        }}>
          <div style={{
            width: '12px',
            height: '12px',
            backgroundColor: '#93C5FD',
            borderRadius: '50%',
            animation: 'pulse 2s infinite',
          }} />
          <span style={{ color: '#93C5FD' }}>LLM Interface v2.0</span>
        </div>

        {/* Chat Messages */}
        <div style={{ 
          padding: '20px',
          height: '280px',
          overflowY: 'auto',
          display: 'flex',
          flexDirection: 'column',
          gap: '12px',
        }}>
          {messages.slice(0, activeMessage + 1).map((message, index) => (
            <div
              key={index}
              style={{
                backgroundColor: message.type === 'user' ? 'rgba(147, 197, 253, 0.1)' : 
                              message.type === 'system' ? 'rgba(96, 165, 250, 0.05)' :
                              'rgba(147, 197, 253, 0.15)',
                padding: '12px 16px',
                borderRadius: '12px',
                maxWidth: message.type === 'user' ? '80%' : '90%',
                alignSelf: message.type === 'user' ? 'flex-end' : 'flex-start',
                animation: 'fadeInUp 0.5s ease-out',
              }}
            >
              <div style={{ 
                color: message.type === 'system' ? '#60A5FA' : '#93C5FD',
                fontSize: '12px',
                marginBottom: '4px',
              }}>
                {message.type.toUpperCase()}
              </div>
              <div style={{ color: '#FFFFFF' }}>{message.text}</div>
            </div>
          ))}
        </div>

        {/* Processing Bar */}
        <div style={{
          position: 'absolute',
          bottom: 0,
          left: 0,
          right: 0,
          padding: '15px 20px',
          borderTop: '1px solid rgba(147, 197, 253, 0.1)',
          background: 'rgba(13, 14, 20, 0.95)',
          display: 'flex',
          alignItems: 'center',
          gap: '15px',
        }}>
          <div style={{
            flex: 1,
            height: '2px',
            backgroundColor: 'rgba(147, 197, 253, 0.1)',
            borderRadius: '2px',
            overflow: 'hidden',
          }}>
            <div style={{
              height: '100%',
              width: '30%',
              backgroundColor: '#93C5FD',
              animation: 'progress 2s infinite linear',
            }} />
          </div>
          <div style={{ color: '#93C5FD', fontSize: '12px' }}>
            Processing...
          </div>
        </div>
      </div>

      {/* Floating Model Architecture */}
      <div style={{
        position: 'absolute',
        top: '10%',
        right: '10%',
        display: 'flex',
        flexDirection: 'column',
        gap: '8px',
        animation: 'float 3s infinite ease-in-out',
      }}>
        {[4, 3, 2].map((size) => (
          <div key={size} style={{
            width: `${size * 50}px`,
            height: '30px',
            backgroundColor: 'rgba(147, 197, 253, 0.1)',
            borderRadius: '6px',
            border: '1px solid rgba(147, 197, 253, 0.2)',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '12px',
            color: '#93C5FD',
          }}>
            {`Transformer Layer ${size}`}
          </div>
        ))}
      </div>

      {/* Attention Visualization */}
      <svg style={{
        position: 'absolute',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
        pointerEvents: 'none',
      }}>
        {Array.from({ length: 8 }).map((_, i) => (
          <line
            key={i}
            x1={`${30 + Math.random() * 40}%`}
            y1={`${20 + Math.random() * 60}%`}
            x2={`${50 + Math.random() * 40}%`}
            y2={`${40 + Math.random() * 40}%`}
            stroke="#93C5FD"
            strokeWidth="1"
            strokeOpacity="0.2"
            strokeDasharray="4"
          >
            <animate
              attributeName="strokeOpacity"
              values="0.2;0.5;0.2"
              dur={`${2 + Math.random() * 2}s`}
              repeatCount="indefinite"
            />
          </line>
        ))}
      </svg>

      {/* Floating Keywords */}
      {[
        { text: "Attention", top: '15%', right: '75%' },
        { text: "Transformers", top: '75%', right: '15%' },
        { text: "Embeddings", top: '35%', right: '80%' },
        { text: "Fine-tuning", top: '85%', right: '65%' },
        { text: "Tokenization", top: '25%', right: '20%' },
      ].map((keyword, index) => (
        <div
          key={index}
          style={{
            position: 'absolute',
            padding: '8px 16px',
            background: 'rgba(147, 197, 253, 0.1)',
            borderRadius: '20px',
            top: keyword.top,
            right: keyword.right,
            color: '#93C5FD',
            fontSize: '14px',
            backdropFilter: 'blur(5px)',
            border: '1px solid rgba(147, 197, 253, 0.2)',
            animation: `float ${2 + index}s infinite ease-in-out ${index * 0.5}s`,
            cursor: 'pointer',
            transition: 'all 0.3s ease',
          }}
          onMouseEnter={e => {
            e.target.style.transform = 'scale(1.1)';
            e.target.style.backgroundColor = 'rgba(147, 197, 253, 0.2)';
          }}
          onMouseLeave={e => {
            e.target.style.transform = 'scale(1)';
            e.target.style.backgroundColor = 'rgba(147, 197, 253, 0.1)';
          }}
        >
          {keyword.text}
        </div>
      ))}
    </div>
  );
}

export default AIVisual;
